  "\n"
  "void clearWordArray (unsigned * inTargetPtr,\n"
  "                     const unsigned inWordCount) asm (\"clear.word.array\") ;\n"
  "\n"
  "//---------------------------------------------------------------------------------------------------------------------*\n"
  "\n"
  "void clearWordArray (unsigned * inTargetPtr,\n"
  "                     const unsigned inWordCount) {\n"
  "  unsigned wordCount = inWordCount ;\n"
  "  while (wordCount > 0) {\n"
  "    *inTargetPtr = 0 ;\n"
  "    inTargetPtr ++ ;\n"
  "    wordCount -= 1 ;\n"
  "  }\n"
  "}\n"
  "\n"
  "//---------------------------------------------------------------------------------------------------------------------*\n" ;

