  "  SPDR          0x08 $uint16\n"
  "  SPCCR         0x0C $uint8\n"
  "  // SPTCR        0x10 $uint8\n"
  "  // SPTSR        0x14 $uint8\n"
  "  // SPTOR        0x18 $uint8\n"
  "  SPINT         0x1C $uint8\n"
  "}\n"
  "\n"
  "// Real Time Clock\n"
  "registers #RTC 0xE002_4000 {\n"
  "  ILR          0x00 $uint8\n"
  "  CTC          0x04 $uint16\n"
  "  CCR          0x08 $uint8\n"
  "  CIIR         0x0C $uint8\n"
  "  AMR          0x10 $uint8\n"
  "  CTIME0       0x14 $uint32\n"
  "  CTIME1       0x18 $uint32\n"
  "  CTIME2       0x1C $uint32\n"
  "  SEC          0x20 $uint8\n"
  "  MIN          0x24 $uint8\n"
  "  HOUR         0x28 $uint8\n"
  "  DOM          0x2C $uint8\n"
  "  DOW          0x30 $uint8\n"
  "  DOY          0x34 $uint16\n"
  "  MONTH        0x38 $uint8\n"
  "  YEAR         0x3C $uint16\n"
  "  ALSEC        0x60 $uint8\n"
  "  ALMIN        0x64 $uint8\n"
  "  ALHOUR       0x68 $uint8\n"
  "  ALDOM        0x6C $uint8\n"
  "  ALDOW        0x70 $uint8\n"
  "  ALDOY        0x74 $uint16\n"
  "  ALMON        0x78 $uint8\n"
  "  ALYEAR       0x7C $uint16\n"
  "  PREINT       0x80 $uint16\n"
  "  PREFRAC      0x84 $uint16\n"
  "}\n"
  "\n"
  "// Bank Configuration registers\n"
  "registers #BCF 0xFFE0_0000 {\n"
  "  G0          0x00 $uint32\n"
  "  G1          0x04 $uint32\n"
  "  G2          0x08 $uint32\n"
  "  G3          0x0C $uint32\n"
  "}\n"
  "\n"
  "// CAN Controllers\n"
  "registers #CAN 0xE004_4000 {\n"
  "  CMR [4] 0x4 @inc 1 << 14 $uint8 {\n"
  "    STB3, STB2, STB1, SRR, CDO, RRB, AT, TR\n"
  "  }\n"
  "//  AMFR          0xE003_C000 $uint32\n"
  "//  SFF_SA        0xE003_C004 $uint32\n"
  "//  SFF_GRP_SA    0xE003_C008 $uint32\n"
  "//  EFF_SA        0xE003_C00C $uint32\n"
  "//  EFF_GRP_SA    0xE003_C010 $uint32\n"
  "//  END_OF_TABLES 0xE003_C014 $uint32\n"
  "}\n"
  "\n"
  "// Analog/Digital Converter (ADC)\n"
  "registers #AD 0xE003_4000 {\n"
  "  CR           0x00 $uint32\n"
  "  GDR          0x04 $uint32\n"
  "  INTEN        0x0C $uint32\n"
  "}\n"
  "\n"
  "//------------------------------------------------------------------------------\n" ;

